CASE SPUN TO BR. 30 (RESERVE JUDGE FLYNN) FROM BR. 35, JUDGE ROSA'S COURT

Defendant Melvin Deonte Elim in court with Attorney Thomas John Erickson.  Defendant Melvin Deonte Elim in custody.  Jacob Daniel Corr appeared for the State of Wisconsin.

Matter here for sentencing.  Sentencing proceeded.  Statements by the State, defense and defendant.  AS TO COUNT #1:  The Court imposed the following sentence:  The Defendant's TOTAL LENGTH OF SENTENCE shall be EIGHT (8) years CONCURRENT to any other sentence.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for FOUR (4) years.  Defendant shall serve FOUR (4) years on EXTENDED SUPERVISION.  

AS TO COUNT #2:  The Court imposed the following sentence:  The Defendant's TOTAL LENGTH OF SENTENCE shall be EIGHT (8) years CONCURRENT to Count #1.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for FOUR (4) years.  Defendant shall serve FOUR (4) years on EXTENDED SUPERVISION.  

The defendant is eligible for the Challenge Incarceration Program 
The defendant is not eligible for the Wisconsin Substance Abuse Program.  

The Court advised the defendant of the determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 

CONDITIONS OF EXTENDED SUPERVISION:
 - No controlled substances or alcohol; Absolute Sobriety;
 - AODA assessment; treatment, if needed; 
 - Random urine screens to ensure compliance;
 - Seek and maintain employment;
 - Pay the DNA surcharge, costs and disbursements.  Court ordered monies taken by the Department of Correction from up to 25% of prison funds.  Balance would be then be paid while on Extended Supervision.  Defendant to pay $50 a month towards balance of fees starting four months after his release;

